                "$ref": "#/definitions/DirectoryPermissionDto"
              }
            }
          }
        }
      }
    },
    "/api/DirectoryService/GetDomains": {
      "get": {
        "tags": [
          "DirectoryService"
        ],
        "summary": "Gets domains",
        "description": "Client Credentials Flow required permissions: Users or Users.Read.\r\n\r\nRequired permissions: Users.View.",
        "operationId": "DirectoryService_GetDomains",
        "produces": [
          "application/json"
        ],
        "responses": {
