    "/api/DirectoryService/SearchForUsersAndGroups": {
      "get": {
        "tags": [
          "DirectoryService"
        ],
        "summary": "Search users and groups",
        "description": "Client Credentials Flow required permissions: Users or Users.Read.\r\n\r\nRequired permissions: Users.View.",
        "operationId": "DirectoryService_SearchForUsersAndGroups",
        "produces": [
